import * as React from "react";
import styled from "styled-components";

const Wrapper=styled.div`
    color:white;

    &>div>*{
        position: absolute;
    }
    &>*{
        position: absolute;
    }
    &>div .back{
        width:100vw;
    }
`;

const Preview=props=>{
    return(
        <Wrapper>
            <div className="back">
                <img
                src="https://occ-0-988-993.1.nflxso.net/dnm/api/v6/6AYY37jfdO6hpXcMjf9Yu5cnmO0/AAAABSpHMNyvIRy6PolVWkmMg80JA0Kdcldq3vIxohYsRrtBKVZEyJAW6ls4b6EoKP7DzCQ6Fvnq5C694tN5eN06_Hb5gHp2.webp?r=105"
                alt="111"
                />
            </div>
            <div>
                <img className="logo" src="https://occ-0-988-993.1.nflxso.net/dnm/api/v6/5e0byrbbfBPBmtxyXMpKqMuqOQY/AAAABduWV1XI_V1CpMePQjJ8-_aIvKPmyAvR8CAXcOAAOByHH-uTuwXXxspW-VTWODhxZtUSBI1BPK3cvJE818mM1QQ_e73MVBZPxu6c.webp?r=9a5" alt=""/>
            </div>
            <div>
	            격동의 구한말, 불꽃처럼 타오르는 여인이 있다. 조국을 위해 <br />
                가시밭길을 택한 명문가의 규수. 그녀가 한 사내를 만난다. <br />
                동지인지, 적인지, 그저 이방인인지 모를 사내를. <br />
            </div>
            <button>재생</button>
            <button>내가 찜한 콘텐츠</button>
            <button>상세 정보</button>
        </Wrapper>
    )
}

export default Preview;
